app.get('/blotter', (req, res) => {
    Request.post({
        "headers": {
            'Content-Type': req.headers["content-type"],
            'Authorization': req.headers.authorization
        },
        "url": 'http://10.236.4.20:1421/blotter?State=' + req.query.State
    }, (error, response, body) => {
        if (error) {
            return console.log(error);
        }
        var respuesta = JSON.parse(body);
        if (respuesta.Message === "User unauthorized or token has expired") {
            console.log("Enviando Usuario No Autorizado");
            res.status(401).send(body);
        } else {
            res.status(200).send(body);
        }

    });

});


